// filepath: /C:/ComplainBHNA/front/src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/login';
import Home from './components/home';
import ComplainSubmit from './components/complainSubmit';
import ComplaintDetails from './components/complainDetails';
import ComplaintDetailsPage from './components/complaintDetailspage';


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login/>} />
        <Route path="/Home" element={<Home/>} />
        <Route path="/ComplainSubmit" element={<ComplainSubmit/>} />
        <Route path="/ComplaintDetails" element={<ComplaintDetails/>} />
        <Route path="/ComplaintDetailspage" element={<ComplaintDetailsPage/>} />
      </Routes>
    </Router>
  );
}

export default App;
